Adaptive Cards in Microsoft Teams do not support changing the background color of the entire card. However, you can change the background color of individual elements within the card, such as containers or columns.

Here's an example of how to change the background color of a container:
```json
{
    "type": "AdaptiveCard",
    "body": [
        {
            "type": "Container",
            "style": "emphasis",
            "items": [
                {
                    "type": "TextBlock",
                    "text": "This is a container with a background color"
                }
            ],
            "backgroundImage": {
                "url": "data:image/png;base64,iVBORw0KGg...."
            }
        }
    ],
    "actions": [],
    "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
    "version": "1.0"
}
```
In the above example, the `backgroundImage` property is used to set the background color of the container. The value of the `url` property is a base64-encoded string of a 1x1 pixel image with the desired color.

You can generate a base64-encoded string of a 1x1 pixel image with the desired color using an online tool such as [this one](https://www.base64-image.de/).

Note that the `style` property of the container is set to `emphasis` to ensure that the background color is applied.

Unfortunately, there is no direct way to change the background color of the entire Adaptive Card in Microsoft Teams.

To create a tooltip in NextJS using React Context to close the previously opened tooltip, you can follow these steps:

1. Create a Tooltip Context:

First, create a context for the tooltip component. This context will be used to manage the state of the tooltip and provide a way to close the previously opened tooltip.

```jsx
import React from 'react';

const TooltipContext = React.createContext();

export default TooltipContext;
```

2. Create a Tooltip Provider:

Next, create a provider component that will wrap the tooltip components and provide the context to them. This provider will manage the state of the tooltip and provide a way to close the previously opened tooltip.

```jsx
import React, { useState } from 'react';
import TooltipContext from './TooltipContext';

const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, closeTooltip, openTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```

3. Create a Tooltip Component:

Now, create a tooltip component that will use the context to manage its state. This component will receive an `id` prop that will be used to identify the tooltip and close it if it's not the active one.

```jsx
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ id, children }) => {
  const { activeTooltip, closeTooltip, openTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    if (activeTooltip && activeTooltip !== id) {
      closeTooltip();
    }
    openTooltip(id);
  };

  const handleMouseLeave = () => {
    closeTooltip();
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      {children}
      {activeTooltip === id && (
        <div className="tooltip">
          {/* Tooltip content */}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

4. Use the Tooltip Provider and Component:

Finally, use the `TooltipProvider` component to wrap the tooltip components and provide the context to them. Then, use the `Tooltip` component to create tooltips in your application.

```jsx
import React from 'react';
import TooltipProvider from './TooltipProvider';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip id="tooltip1">
          Hover over me
        </Tooltip>
        <Tooltip id="tooltip2">
          Hover over me
        </Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

With this implementation, when you hover over a tooltip, it will open and the previously opened tooltip will close. When you hover out of the tooltip, it will close.
